{quote}main-sail-driven servo tiller{quote}
simple setup with one (green) rope attaching to the rear of boom, one rope (red, I use the loose end of traveler sheet) attaching to the tiller handle via reversing block, and green rope attaching to red one via stopperstek
requires 2 minutes manual setup initially and after each tack / jibe

